import * as React from 'react';
import {memo} from 'react';
import Svg, {Image} from 'react-native-svg';

const imageUri1 =
    'data:image/png;base64,';

const imageUri2 =
    'data:image/png;base64,';

const ClawMarksSvg = memo(({size = 62, rotateType = 'regular', ...props}) => {
    const rotation = rotateType === 'regular' ? 'rotate(-31 16 58)' : 'rotate(-41 18 59)';
    return (
        <Svg width={size} height={size} viewBox="34 34 80 80" fill="none" style={{overflow: 'hidden'}} {...props}>
            <Image x={16} y={58} width={81} height={81} href={{uri: imageUri1}} transform={rotation} />
            <Image x={18} y={59} width={79} height={79} href={{uri: imageUri2}} transform={rotation} />
        </Svg>
    );
});

export default ClawMarksSvg;
